CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_frm_RegLecturas`(
IN op int,
IN p_idmedidor int,
IN p_periodo int,
IN p_anio int,
IN p_lectura int,
IN p_consumo int,

OUT o_periodoAnt int,
OUT o_anioAnt int,
OUT o_lectura int,
OUT o_lecturaAnt int
)
BEGIN

/*VARIABLES PARA LECTURAS Y PERIODOS*/
DECLARE v_lectura int;
DECLARE v_lecturaAnt int;
DECLARE v_periodo int;
DECLARE v_periodoAnt int;
DECLARE v_anio int;
DECLARE v_anioAnt int;

if(op=1) then
	/*altas todos las lecturas y consumos*/
	set v_periodoAnt=p_periodo-1;
    set v_anioAnt=p_anio;
    if(v_periodoAnt=0)then
		set v_periodoAnt=12;
		set v_anioAnt=p_anio-1;
	end if;
	/*Verificamos si existe lectura en el periodo anterior en caso de existir*/
    if exists(SELECT * from gestion_granjas.reg_lecturas WHERE id_medidor=p_idmedidor and periodo=p_periodo and anio=p_anio) then
		/*si existe modificamos*/
        UPDATE gestion_granjas.reg_lecturas SET lectura=p_lectura, fecha_lectura=now() where id_medidor=p_idmedidor and periodo=p_periodo and anio=p_anio;
        /*modifica consumo 280117*/
        UPDATE gestion_granjas.consumos SET consumo=p_consumo, fecha_registro=now() where id_medidor=p_idmedidor and periodo=p_periodo and anio=p_anio;
	else
		INSERT INTO gestion_granjas.reg_lecturas (id_medidor, lectura,periodo,anio,fecha_lectura) VALUES(p_idmedidor,p_lectura,lpad(p_periodo,2,0),p_anio,now());
        /*modifica consumo 280117*/
        INSERT INTO gestion_granjas.consumos (id_medidor,periodo,anio,consumo,fecha_registro) VALUES(p_idmedidor,lpad(p_periodo,2,0),p_anio,p_consumo,now());
    end if;
    set o_periodoAnt=v_periodoAnt;
	set o_anioAnt= v_anioAnt;
    SELECT lectura into o_lectura from gestion_granjas.reg_lecturas WHERE id_medidor=p_idmedidor and periodo=p_periodo and anio=p_anio;
    SELECT lectura into o_lecturaAnt from gestion_granjas.reg_lecturas WHERE id_medidor=p_idmedidor and periodo=o_periodoAnt and anio=o_anioAnt;
	
elseif(op=2)then
	set v_periodoAnt=p_periodo-1;
    set v_anioAnt=p_anio;
    if(v_periodoAnt=0)then
		set v_periodoAnt=12;
		set v_anioAnt=p_anio-1;
	end if;
        
    if exists(SELECT * from gestion_granjas.reg_lecturas WHERE id_medidor=p_idmedidor and periodo=p_periodo and anio=p_anio) then
		SELECT 
        lectura
        into o_lectura
        from gestion_granjas.reg_lecturas WHERE id_medidor=p_idmedidor and periodo=p_periodo and anio=p_anio;
    end if;
    if exists(SELECT * from gestion_granjas.reg_lecturas WHERE id_medidor=p_idmedidor and periodo=v_periodoAnt and anio=v_anioAnt) then
		SELECT 
        lectura
        into o_lecturaAnt
        from gestion_granjas.reg_lecturas WHERE id_medidor=p_idmedidor and periodo=v_periodoAnt and anio=v_anioAnt;
		set o_periodoAnt=v_periodoAnt;
		set o_anioAnt=v_anioAnt;
    end if;
    
    if(isnull(o_periodoAnt))then
		set o_periodoAnt=0;
    end if;
    if(isnull(o_anioAnt))then
		set o_anioAnt=0;
    end if;
    if(isnull(o_lectura))then
		set o_lectura=0;
    end if;
    if(isnull(o_lecturaAnt))then
		set o_lecturaAnt=0;
    end if;

elseif(op=3)then        
    if exists(SELECT * from gestion_granjas.cuotas_base_agua WHERE id_factor=p_idmedidor and periodo=p_periodo and anio=p_anio) then
		SELECT 
        cuota
        into o_lectura
        from gestion_granjas.cuotas_base_agua WHERE id_factor=p_idmedidor and periodo=p_periodo and anio=p_anio;
    end if;
    
    if(isnull(o_periodoAnt))then
		set o_periodoAnt=0;
    end if;
    if(isnull(o_anioAnt))then
		set o_anioAnt=0;
    end if;
    if(isnull(o_lectura))then
		set o_lectura=0;
    end if;
    if(isnull(o_lecturaAnt))then
		set o_lecturaAnt=0;
    end if;

elseif(op=4) then
	/*altas todos las CBA asignas mensualmente*/
	
	/*Verificamos si existe lectura en el periodo anterior en caso de existir*/
    if exists(SELECT * from gestion_granjas.cuotas_base_agua WHERE id_factor=p_idmedidor and periodo=p_periodo and anio=p_anio) then
        /*modifica consumo 280117*/
        UPDATE gestion_granjas.cuotas_base_agua SET cuota=p_lectura, fecha_registro=now() where id_factor=p_idmedidor and periodo=p_periodo and anio=p_anio;
	else
    /*modifica consumo 280117*/
		INSERT INTO gestion_granjas.cuotas_base_agua (id_factor, cuota,periodo,anio,fecha_registro) VALUES(p_idmedidor,p_lectura,lpad(p_periodo,2,0),p_anio,now());
    end if;
    set o_periodoAnt=0;
	set o_anioAnt= 0;
    set o_lecturaAnt= 0;
    SELECT cuota into o_lectura from gestion_granjas.cuotas_base_agua WHERE id_factor=p_idmedidor and periodo=p_periodo and anio=p_anio;
end if;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
