CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_rpt_cobranza`(
IN op int,
IN p_periodo int,
IN p_anio int,
IN p_medidor int
)
BEGIN
DECLARE v_periodo int;
DECLARE v_periodoAnt int;
DECLARE v_anio int;
DECLARE v_anioAnt int;

if(op=1) then
	if(p_medidor!=0) then
	/*SE OBTIENEN LOS DATOS DEL COLONO, ASI COMO MEDIDOR Y SU RESPECTIVOS DATOS DE CONTRATO*/
	SELECT
		a.id_lote, 
		a.id_manzana, 
		c.nombre, 
		b.manzana, 
		a.lote, 
		e.cuota, 
		a.metros_cuadrados,  
		d.contrato, 
		d.medidor, 
		d.id_medidor
		FROM gestion_granjas.cat_lotes a inner join gestion_granjas.cat_manzanas b
		on a.id_manzana=b.id_manzana 
		left join gestion_granjas.cat_colonos c 
		on a.id_colono=c.id_colono 
		left join gestion_granjas.cat_medidores d
		on a.id_lote=d.id_lote
		left join gestion_granjas.cuotas_base_agua e
		on d.id_medidor=e.id_factor
		where a.id_lote=p_medidor and e.periodo=p_periodo and e.anio=p_anio and  a.estatus='A'  order by a.id_manzana, a.id_lote asc;
	else
		/*SE OBTIENEN LOS DATOS DEL COLONO, ASI COMO MEDIDOR Y SU RESPECTIVOS DATOS DE CONTRATO*/
	SELECT
		a.id_lote, 
		a.id_manzana, 
		c.nombre, 
		b.manzana, 
		a.lote, 
		e.cuota, 
		a.metros_cuadrados,  
		d.contrato, 
		d.medidor, 
		d.id_medidor
		FROM gestion_granjas.cat_lotes a inner join gestion_granjas.cat_manzanas b
		on a.id_manzana=b.id_manzana 
		left join gestion_granjas.cat_colonos c 
		on a.id_colono=c.id_colono 
		left join gestion_granjas.cat_medidores d
		on a.id_lote=d.id_lote
		left join gestion_granjas.cuotas_base_agua e
		on d.id_medidor=e.id_factor
		where a.id_manzana=1 and e.periodo=p_periodo and e.anio=p_anio and  a.estatus='A'  order by a.id_manzana, a.id_lote asc;
	end if;

elseif(op=2)then
/*SE OBTIENEN LAS LECTURAS ANTERIORES, ACTUALES Y CONSUMOS */
set v_periodoAnt=p_periodo-1;
    set v_anioAnt=p_anio;
    if(v_periodoAnt=0)then
		set v_periodoAnt=12;
		set v_anioAnt=p_anio-1;
	end if;
    
	SELECT 
		a.id_lectura, 
        a.id_medidor,
        ifnull((SELECT b.lectura from gestion_granjas.reg_lecturas b WHERE b.id_medidor=a.id_medidor and b.periodo=v_periodoAnt and b.anio=v_anioAnt),0) as lec_anterior, 
        a.lectura, 
        ifnull(a.lectura-ifnull((SELECT b.lectura from gestion_granjas.reg_lecturas b WHERE b.id_medidor=a.id_medidor and b.periodo=v_periodoAnt and b.anio=v_anioAnt),0),0) as consumo,
        a.periodo,
        a.anio, 
        a.estatus 
	from gestion_granjas.reg_lecturas a 
    WHERE a.id_medidor=p_medidor and periodo=p_periodo and anio=p_anio;
elseif(op=3) then
/*SE OBTINEN LOS CBA ANUALES, Y CBA ASIGNADO AL MES EN CURSO  CORRESPONDIENTES A CADA MEDIDOR*/
	SELECT 
		sum(cuota) as anual, 
        (SELECT sum(cuota) FROM gestion_granjas.cuotas_base_agua where id_factor=p_medidor and periodo<=p_periodo and anio=p_anio) as al_momento
	FROM 
		gestion_granjas.cuotas_base_agua 
    where 
		id_factor=p_medidor and anio=p_anio;
elseif(op=4) then

SELECT 
	a.id_medidor,
   ifnull((SELECT b.lectura  from gestion_granjas.reg_lecturas b WHERE b.id_medidor=a.id_medidor 
    and b.periodo=date_format(DATE_ADD(concat(a.anio,"-",a.periodo,"-01"),INTERVAL -1 MONTH ),'%m')
    and b.anio=date_format(DATE_ADD(concat(a.anio,"-",a.periodo,"-01"),INTERVAL -1 MONTH ),'%Y')),0) as lec_ant, 
    a.lectura, 
   ifnull(sum(ifnull((SELECT a.lectura - ifnull(b.lectura,0)  from gestion_granjas.reg_lecturas b WHERE b.id_medidor=a.id_medidor 
    and b.periodo=date_format(DATE_ADD(concat(a.anio,"-",a.periodo,"-01"),INTERVAL -1 MONTH ),'%m')
    and b.anio=date_format(DATE_ADD(concat(a.anio,"-",a.periodo,"-01"),INTERVAL -1 MONTH ),'%Y')),a.lectura)),0) as consumo,
    a.periodo,
    a.anio, 
    a.estatus 
from gestion_granjas.reg_lecturas a WHERE id_medidor=p_medidor and periodo<=p_periodo and anio=p_anio and estatus='A';

elseif(op=5) then
SELECT 
	consumo,
    tarifa, 
    cuota_tarifa,
    importe 
FROM 
	gestion_granjas.kardex_servicios_detalle 
where 
	id_factor=p_medidor and id_servicio=3 and id_concepto=1 and periodo=p_periodo and anio=p_anio;

elseif(op=6) then
SELECT 
ifnull((SELECT sum(b.importe) FROM gestion_granjas.kardex_servicios b where b.id_factor=a.id_factor and b.id_servicio=3 and b.periodo<p_periodo and b.anio=p_anio and b.estatus='V'),0) as adeudos,
ifnull(SUM(importe),0) as mora
FROM gestion_granjas.kardex_servicios_detalle a
where id_factor=p_medidor and id_servicio=3 and id_concepto=2 and periodo<p_periodo and anio=p_anio and estatus='A';

/* CUOTAS DE MANTENIMIENTO
p_medidor es para id lote tan wei
 */
elseif(op=7) then
SELECT 
	importe 
FROM gestion_granjas.kardex_servicios 
where id_factor=p_medidor and id_servicio=2 and periodo=p_periodo and anio=p_anio;

elseif(op=8) then
SELECT 
ifnull((SELECT sum(b.importe) FROM gestion_granjas.kardex_servicios b where b.id_factor=a.id_factor and b.id_servicio=2 and b.periodo<p_periodo and b.anio=p_anio and b.estatus='V'),0) as adeudos,
ifnull(SUM(importe),0) as mora
FROM gestion_granjas.kardex_servicios_detalle a
where id_factor=p_medidor and id_servicio=2 and id_concepto=2 and periodo<p_periodo and anio=p_anio and estatus='A';

/* GRAFICA NO 3 */
elseif(op=9) then
SET lc_time_names = 'es_UY';
/*se modifico por la tabla de consumos recien agregada
SELECT c.id_medidor, date_format(concat(a.anio, a.periodo,'01'), '%b') as periodo,a.anio,ifnull((a.lectura - ifnull(b.lectura,0)),0) as consumo
	FROM gestion_granjas.reg_lecturas a
    LEFT JOIN gestion_granjas.reg_lecturas b ON a. id_medidor=b.id_medidor
    and (SELECT date_format(DATE_ADD(CONCAT(a.anio,'-',LPAD(a.periodo,2,'0'),"-01"),INTERVAL -1 MONTH ),'%m') 
       from dual)=b.periodo
	and (SELECT date_format(DATE_ADD(CONCAT(a.anio,'-',LPAD(a.periodo,2,'0'),"-01"),INTERVAL -1 MONTH ),'%Y') 
       from dual)=b.anio
      left join gestion_granjas.cat_medidores as c
	on a.id_medidor=c.id_medidor 
	where c.id_medidor=p_medidor and a.anio>=p_anio-2 and a.anio<=p_anio
			 order by a.periodo, a.anio asc;
*/
/*
SELECT 
    id_medidor, periodo, anio, consumo
FROM
    gestion_granjas.consumos
WHERE
    id_medidor=p_medidor and anio>=p_anio-2 and anio<=p_anio
			 order by periodo, anio asc;*/
             
select b.id_medidor, a.periodo, a.anio, ifnull(b.consumo,0)  from(
select concat(anio,'-',periodo,'-01'), periodo, anio from cat_periodos a ,cat_anio b) a
left join consumos b
on b.id_medidor=p_medidor and b.periodo=a.periodo and b.anio=a.anio
where a.anio>=p_anio-2 and a.anio<=p_anio  order by a.periodo, a.anio asc;
    
elseif(op=10)then
SELECT 
	id_factor,periodo,anio, cuota 
FROM gestion_granjas.cuotas_base_agua 
where id_factor=p_medidor and anio=p_anio order by anio,periodo;

elseif(op=11) then
SELECT
	a.id_medidor,
     a.periodo,
    a.anio,
   ifnull(sum(ifnull((SELECT a.lectura - ifnull(b.lectura,0)  from gestion_granjas.reg_lecturas b WHERE b.id_medidor=a.id_medidor
    and b.periodo=date_format(DATE_ADD(concat(a.anio,"-",a.periodo,"-01"),INTERVAL -1 MONTH ),'%m')
    and b.anio=date_format(DATE_ADD(concat(a.anio,"-",a.periodo,"-01"),INTERVAL -1 MONTH ),'%Y')),a.lectura)),0) as consumo,
    b.cuota as CBA,
     a.estatus
    
from gestion_granjas.reg_lecturas a 
left join gestion_granjas.cuotas_base_agua b on a.id_medidor=b.id_factor and b.periodo=a.periodo and b.anio=a.anio where a.id_medidor=p_medidor and a.anio=p_anio group by a.periodo;


end if;
END ;;
DELIMITER ;
