CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_valida_Periodo_Captura`(
in in_op int,
out out_valor int)
BEGIN
DECLARE v_anio varchar(6);
/*primero obtenemos el ejercicio activo (año)*/
SELECT anio into v_anio FROM gestion_granjas.cat_anio  WHERE estatus='A';
/*VALIDA PERIODOS CAPTURADOS POR CADA OPCION CBA, LECTURAS, MANTENIMIENTO,ETC*/
if(in_op=1) then
/*OPCION PARA VERIFICAR REGIOSTRP DE LECTURAS DE AGUA*/
	SELECT count(periodo) into out_valor FROM gestion_granjas.bitacora_cuotas where anio=v_anio and servicio=1;
elseif(in_op=2) then
/*OPCION PARA VERIFICAR REGIOSTRP DE AGUA*/
	SELECT count(periodo) into out_valor FROM gestion_granjas.bitacora_cuotas where anio=v_anio and servicio=2;
elseif(in_op=3) then
/*OPCION PARA VERIFICAR REGIOSTRP DE MANTENIMIENTO*/
	SELECT count(periodo) into out_valor FROM gestion_granjas.bitacora_cuotas where anio=v_anio and servicio=3;
elseif(in_op=4) then
/*OPCION PARA VERIFICAR REGIOSTRP DE CBA*/
	SELECT count(periodo) into out_valor FROM gestion_granjas.bitacora_cuotas where anio=v_anio and servicio=4;
end if;

END ;;
